SELECT DISTINCT ?Seed WHERE{
	?Seed 	 rdf:type 	 <http://dbpedia.org/ontology/Scientist> . 
	{?Seed	<http://dbpedia.org/ontology/academicAdvisor>	<http://dbpedia.org/resource/William_Hopkins>.} UNION 
	{?Seed	<http://dbpedia.org/ontology/academicDiscipline>	<http://dbpedia.org/resource/Anthropology>.} UNION 
	{?Seed	<http://dbpedia.org/ontology/almaMater>	<http://dbpedia.org/resource/King's_College_London>.} 
}

SELECT (COUNT (?Seed) AS ?count) WHERE{
	?Seed 	 rdf:type 	 <http://dbpedia.org/ontology/RailwayLine> . 
	MINUS{ 
		{?Seed	<http://dbpedia.org/ontology/location>	<http://dbpedia.org/resource/Northeast_megalopolis>.} UNION 
		{?Seed	<http://dbpedia.org/ontology/operator>	<http://dbpedia.org/resource/Long_Island_Rail_Road>.} 
	} 
}

SELECT DISTINCT ?Seed WHERE{ 
	?Seed 	 rdf:type 	 <http://dbpedia.org/ontology/MilitaryPerson> .
	?Seed	<http://dbpedia.org/ontology/child>	?count. 
} GROUP BY ?Seed 
 HAVING (COUNT(?count) >= 6)

SELECT DISTINCT ?Seed WHERE{ 
	?Seed 	 rdf:type 	 <http://dbpedia.org/ontology/Place> .
	?Seed	<http://dbpedia.org/ontology/manager>	?count. 
} GROUP BY ?Seed 
 HAVING (COUNT(?count) <= 6)

